"vacation_message": "Our shop is temporarily on vacation. ",
"sale_message": "Thank you so much for your purchase. Your order is on its way!\r\n\r\nJEWELRY CARE:\r\nIf you have purchased a jewelry item, please note that these are delicate pieces and should be handled gently. Do not spray perfumes or any other sprays containing any alcohol and/or chemicals directly onto your jewelry item. These items are also not safe for wear in chlorinate or salt water. If you choose to wear perfume, allow it to dry fully before wearing this item to prevent corrosion.\r\n\r\nSHIPPING INFORMATION:\r\n***Please note that Eclectic Red&#39;s is not responsible for your package after it has been sent in the post. If you have a question about the tracking of your order, please check with Etsy tracking or contact USPS with your tracking number. If your address has been put in wrong and needs to be changed before shipping, please notify us via Etsy message ASAP and we will work with you to make sure it gets to the correct address.***\r\n\r\nThanks again, and enjoy!\r\n\r\nEclectic Red&#39;s",
