"login_name": "EclecticRedsDallas",
"accepts_custom_requests": true,
"policy_welcome": "Here at Eclectic Red&#39;s, we love what we do and we want you to love it, too!\r\n\r\nHave a question about a custom order? We are always happy to work with you to create something one-of-a-kind just for you (all of your friends will be super jelly)!\r\n\r\nWe strive to get your order shipped out as quick as we can so you can start enjoying your custom item. Although we generally ship quickly, please allow for slightly more time during holiday periods for us to get your items out, as we have a high volume of orders at these times (although we will still try to get it shipped out asap!).",
"policy_payment": "We work quickly to get your order out, so we ask that if you plan to cancel your purchase, please do so within 4 hours of your order as these items are custom made to your specifications and can not always be re-sold. If there are any changes that need to be made to your order, please contact us ASAP. We make our items as the orders come in.",
"policy_shipping": "All items are sent using USPS services.\r\n\r\nDomestic orders average 3-5 business days for delivery after shipment.\r\n\r\nInternational orders average 5-15 business days for delivery after shipment.\r\n\r\nEclectic Red&#39;s is not responsible for postal delays, lost or stolen packages. Please contact your local post office with your USPS tracking number via Etsy if you have questions about your package.\r\n\r\nIf you are looking to upgrade to a different or quicker shipping method, please message me BEFORE you purchase WITH your shipping address zip code, as your upgrade pricing will need to be added to your order. ",
"policy_refunds": "At Eclectic Red&#39;s, we do our best to make our customers happy! If your purchase is broken or damaged, please notify us within 15 days of receiving your item and we will work together with you to either get your item fixed or send you a new one ASAP!\r\n\r\nIf you would like a refund due to an item being broken or damaged, please notify us within 15 days of your item arrival (I will use the &quot;date delivered&quot; according to your tracking number).\r\n\r\nWe do not issue refunds for lost or stolen packages, but please message us and we will be glad to work with you towards a solution. \r\n\r\nWe also cannot refund custom items (with specific dates and/or names) since we cannot re-sell them, so please be very clear about when you order your custom items! If the customization is not customized to the directions you have given us, we will gladly refund you.\r\n\r\n***We do not issue refunds for the initial shipping cost; only for the item that you purchased when we have received the item back.***",
"policy_additional": "Please note that the majority of our items are delicate and should be handled gently and with care. To insure that your jewelry item stays in shape and lookin&#39; fly, avoid any abrasive rubbing, scratching and/or pulling of the item. Excessive wear in water, salt or otherwise, may also effect your item.\r\n\r\nIf there are any changes that need to be made to your order, please contact us ASAP. We make our items as the orders come in.\r\n\r\nEclectic Red&#39;s takes great care in crafting our items and is not responsible for any damages made by the customer. ",
"policy_seller_info": "For custom orders or general questions about our items and other policies, please contact us either through Etsy messaging or at eclecticreds@gmail.com.",
