"description": "FF04 - Medieval and Renaissance Paned Slops and Breeches Pattern.  Paned Slops and Breeches Pattern, Multisized 32&quot;-44&quot; waist. This pattern for Renaissance men&#39;s pants includes: Simple paned pants, with and without edge trim and piping Elaborately decorated pants, with and without slashes and cutouts, Simple un-paned pants. The Paned Slops and Breeches pattern is from the &quot;Fantasy Fashions&quot; series. The patterns are produced especially for making medieval outfits that are easily and comfortably worn today without sacrificing authenticity. Multiple sizes are available with each pattern. The instructions are clear and easy to follow, with many hints for proper construction and fit. Waist sizes from 32 inches through 44 inches are given, with instructions to make the pattern adjustable for any size. The instructions are clear and easy to follow, with hints for proper construction and fit. This pattern set is easy to follow, with few pieces for each of the items. This pattern is fairly easy, except that the &quot;rise&quot; for the easy breeches needs to be fitted. Apparently the instructions for fitting the rise are not as clear as they could be for someone who has never fitted men&#39;s pants. Be sure to have someone help you with this part or make a mock up with cheap fabric and fit that to your man before cutting into your expensive velvet or brocade! \r\n\r\n Great for Musketeer, Tudor, Medieval, Renaissance Clothing. Excellent for SCA events, Medieval living history events, Robin Hood, Merlin\r\nPerfect for Game of Thrones Costume and for Steam Punk Living history events",
