"digital_sale_message": "Thank you for purchasing my digital PDF download! \r\n\r\nWhilst you are free to make and sell your handcrafted items made from this tutorial please note that this digital tutorial is for private use only. Reproduction and distribution of instructions is strictly prohibited and is copyrighted material owned by Petershams Millinery. This listing is for a digital tutorial only and does not include materials.\r\n\r\nThanks again and happy crafting!\r\nPetershams Millinery\r\n",
"last_updated_tsz": 1432239903,
"listing_active_count": 1290,
"login_name": "squirlgirl",
"accepts_custom_requests": false,
"policy_welcome": "I&#39;m always happy to take custom request, so if you don&#39;t see exactly what you are looking for please give me a shout. I only have a few policies, I&#39;m a simple girl with simple rules so all should go smoothly if we both do our part.",
"policy_payment": "I only take PayPal because it is fast, safe and secure.",
"policy_shipping": "Most order are sent off same day and I aim to ship out all orders within 1-2 working days after payments have been cleared. I always send out an Etsy message to confirm that your item has been shipped.\r\n\r\nDelivery Information:\r\nOrders are shipped from London, England with expected delivery times of:\r\nWithin the UK: 1-5 Working days (by 1st Class Post)\r\nOutside of the UK: 5-15 Working days (by Standard Airmail)\r\n\r\nFor International Orders Please Note:\r\nAll international orders are sent via Royal Mails &#39;Small Packet&#39; standard airmail service with proof of postage obtained. If you require a tracking number or priority shipping please inquire for costs before making your purchase. This will usually range from £20-45 depending on size of package and your location.\r\n\r\nInternational orders sometimes (but rarely) get delayed at customs, so if you are ordering for a special day please keep this in mind.",
"policy_refunds": "If what you ordered was not exactly what you were looking for I am happy to accept returns withing 14 days provided you pay the return postage costs and the item is in resale-able condition.",
"policy_additional": "Please note that you, the buyer is responsible for customs fees should your country impose these.\r\n\r\nAll items come from a happy, clean studio with no pets or smoke.\r\n\r\nI aim to respond to emails and convos within 24 hours M-F, UK Time Zone.\r\n\r\nAll prices include VAT at the standard rate, customers with EU VAT numbers please contact me prior to purchasing for invoicing. \r\n\r\nAll images and written content is Copyright Petershams Millinery Ltd. 2015 and may not be reproduced under any conditions.",
"policy_seller_info": "Petershams Millinery Ltd. \r\nRegistered Company in the UK and Wales\r\nStudio 36, Southwark Studios\r\n40 Crimscott Street, London SE1 5TE\r\nVAT number 200416473\r\nPhone 07737572345",
"policy_updated_tsz": 1418816607,
"vacation_autoreply": "(AUTO REPLY) Hello! I am on a short break and my Etsy store will reopen on April 9th. If you are having a millinery emergency (hey, it happens!) you can reach me at hello@petershams.com and I will get back to you as soon as I possible can.  See you soon! xxx Michelle",
