"title": "Modern, Bridal and Real Flower Jewelry",
"announcement": " Welcome to my etsy shop selling modern and bridal handmade jewelry, Inspired by nature and made with real flowers.   Wishes on the Wind jewelry has been recently featured in Vogue, Marie Claire and many other magazines.  Also stocked in shops and galleries worldwide\r\n\r\nLike me on facebook and look out for giveaways \r\nhttps://www.facebook.com/w1shesonthew1nd\r\n\r\nFeel free to share your pics on my facebook page of you wearing your new piece of your jewelry\r\n\r\n♥Brides I love to do custom orders.  Perfect for gift giving or treating yourself. \r\n\r\n♥Proud to be using eco friendly resin, a bio pine oil based resin, greener and happier:)\r\n\r\n♥ Special offer:  Buy 2 or more more items and receive 15% DISCOUNT with coupon code WISHES15\r\n\r\nWholesale enquiries are welcome\r\n",
"currency_code": "GBP",
"is_vacation": false,
"vacation_message": "Due to a high volume of sales I am closing my shop while I catch up on all existing orders.  \r\nIn this time please be patient, I am working on all current orders  As I am so busy I wont be around to answer questions as normal\r\nHope to re-open in a few days.\r\nSee you soon...",
"sale_message": "Thanks for your purchase from Wishes on the wind\r\nhttp://www.etsy.com/shop/RainbowsontheBeach my other etsy shop selling sea glass jewellery \r\n\r\nfollow me become a fan on facebook and feel free to share pics of you wearing your new piece of jewelry:\r\n\r\nhttps://www.facebook.com/w1shesonthew1nd\r\n",
"digital_sale_message": null,
