"listing_active_count": 151,
"login_name": "owenlana",
"accepts_custom_requests": true,
"policy_welcome": "Handmade Jewelry inspired by nature.    lots of whimsical, fairytale designs and one  of a kind so you will always find something unique, come and have a look\r\nWishes on the Wind is proud to be using eco resin, a bio-resin which is pine oil based as opposed to petroleum based.  Greener and happier:))",
"policy_payment": "payment by paypal at time of purchase\r\nNo paypal account? you can still pay using a debit or credit card. Choose the PayPal option during checkout. Once order submitted click on the ‘Pay Now’ button and choose the option to pay with a credit or debit card without having to sign up for a PayPal account.\r\n\r\n",
"policy_shipping": "All jewelry is well packaged and posted within 24 - 48 hrs, resin flower jewelry 48 - 72hrs.   Items to the UK are sent out by First Class and should arrive within 2 - 3 working days.\r\nItems to the US, Canada, Europe and Australia are sent via standard Airmail which usually takes between 7 - 15 business days. Most items will arrive well within this time frame but can on occassion take a little  longer during holidays or due to adverse weather conditions   PLEASE NOTE TO ITALY I WILL POST USING A SIGNED FOR SERVICE WHICH WILL COST A BIT MORE, PLEASE ASK BEFORE PURCHASING FROM ITALY\r\n\r\nPlease make sure your address is correct before making payment. I can not be responsible for missing delivery due to wrong address.  \r\n\r\nTracking:\r\n\r\nYour item is shipped from the UK where we use standard airmail for all international packages. This is NOT trackable and we are unable to provide any information as to where your package is.\r\n\r\nYou may upgrade to Priority Mail for an additional $8.50. This service is usually a few days quicker than standard airmail and will provide you with a tracking number.\r\n\r\nIt is rare that a package is lost - . If you have concerns about your order please contact me\r\n\r\nPackages can be held up along the way occasionally which may mean that your item takes a little longer to reach you. Mail is not considered lost until 5 weeks have passed from the date of posting.  Please be patient if your item hasn&#39;t arrived within the &#39;estimated&#39; time.\r\n\r\nIf your item has been lost then I will  send a replacement but please bear in mind that I cannot do this until the 5 week period has passed from the date of my posting item..\r\n\r\nI cannot refund postage costs unless an item is faulty\r\n\r\n***packaging details***  If no choice of box made will be sent in signature box\r\n\r\n.PRESENTATION BOX:\r\n\r\nChoose your box design:\r\ncheck listing pics and choose design from:\r\n\r\nLeft: Signature wishesonthewind stamped box \r\nCentre: Romance. Black ribbon and red rose\r\nRight: Dandelion stamp\r\n\r\nYou can see the stamped designs in the background before I have tied with string..\r\n\r\nAll boxes are beautifully presented, tied up with string or ribbon and each design comes with the following verse:\r\n\r\nWishes on the Wind\r\n\r\nBirds are singing in the trees\r\nDandelion puffs blow on the breeze\r\nSending this gift from me to you\r\nMay your dreams and wishes all come true",
"policy_refunds": "Returns are available on all items except earrings due to hygiene reason..\r\n\r\nWill refund cost of item before postage providing item is returned in original condition with 14 days of receiving item,. , buyers are responsible for return postage\r\n\r\nCustom Made / Made to Order. I am unable to offer an exchange or refund on goods that are made to the consumer’s specifications or are  personalised, altered items, made to order or where the customer has requested specific finishing touches. All other items may be returned in saleable condition within 14 days of receipt for a  refund.\r\n\r\nPlease contact me to let me know if you would like to return your item and I will advise you how to do so.",
"policy_additional": "If you require different length chain just ask, I can do wholesale orders if your are online shop or bricks n mortar just ask. \r\nWholesale enquiries are welcome for shops bricks and mortar or online..\r\n\r\n *  Wishes on the Wind Jewellery not recommended for swimming or showering, please store in dry dark place.  Avoid long exposure of sunlight. Glass jewellery not suitable for children.\r\n",
"policy_seller_info": "Lana Butters\r\n20 Station Park\r\nEast Wemyss\r\nFife\r\nScotland\r\nKY14TS\r\nUK\r\n\r\nEmail marlano@virginmedia.com",
