"policy_payment": "Please pay via paypal or direct - if you have any troubles, please contact me directly - tim@curtinscreations.com - and we can make other arrangements.",
"policy_shipping": "I take great care and pride while creating my works, and I take just as much care when shipping so that everything reaches you quickly and safely.  Because my pieces are so delicate, I charge a bit more for shipping and handling.  Its worth it to be sure they arrive intact!\r\n\r\nWork will be shipped within at most two business days, but typically within 24 hours. I ship via UPS Ground or (occasionally) USPS.",
