"title": "Orange, white, black ceramic wine bottle stopper - ooak",
"description": "This wine or whiskey bottle topper is a fun lizard-like creature with a long fin down his back and tail, two legs, and a curly tail. White speckling on orange, and a black mark on each haunch - the glazing is really strong and beautiful up close. Fun, distinctive stoneware and steel art made in Vermont.\r\n\r\nHe&#39;ll look great with his face buried in any bottle - a very distinctive and powerful piece, perfect for your favorite wine, whiskey, vinegar, home-made spirits, or even perfume.\r\n\r\n&quot;Haunches&quot; is about 4 inches long from tip to tip, and about an inch and a quarter across at his widest.\r\n\r\n\r\nHis USA-made business end is made of the highest quality stainless available anywhere, which is then attached using industrial-strength epoxy.  (See my blog for more info if you&#39;re curious about my process.)  Unlike most stoppers that are plated and can flake or pit, these are medical-grade and can be kept in a bottle for as long as you like. These are *not* your run-of-the-mill corner store bottle toppers -- they are a labor of love, each truly one-of-a-kind, take hours to make, and are built to last!\r\n\r\n\r\nAll my creations come very carefully wrapped for safety. If you have special shipping needs, let me know and I&#39;ll certainly accommodate.\r\n\r\n\r\nBlack acrylic display stand included free (other colors available):\r\n   http://www.etsy.com/listing/62666111/wine-bottle-stopper-stand-display\r\n\r\nMy other stoppers are here:\r\n   http://www.etsy.com/shop/CurtinsCreations?section_id=7359176\r\n\r\nVisit my Etsy store::\r\n   http://CurtinsCreations.etsy.com/\r\n\r\nMy blog for thoughts, glaze samples, info about my process and progress, and more:\r\n   http://www.curtinscreations.com\r\n\r\n\r\n\r\n(Online presence by TheArtistsBullhorn.com)",
