"title": "Curtin&#39;s Creations: ceramic artwork... with legs",
"announcement": "Just a potter playing with mud and fire to bring imagination to life.  Unique wine stoppers, creatures, ring stands, bottles & more, handmade in Vermont!\r\n\r\nI&#39;ve been enjoying pottery since 2000 when I sat down at a wheel with a lump of clay and rediscovered the joy of creation.  Since then I&#39;ve been learning to twist clay, fire, and glazes into my own unique expressions.  Functional pieces are fine, but right now, I&#39;m focused on my wine stoppers and Curly Creatures.  Whimsical little things, each creature is thrown on a wheel, carefully pulled off to add a tail, then hand-modified to add fins, legs, scales... anything you or I can imagine!  Stoppers are similar, but totally handbuilt.  I try to give each piece its own personality, but all almost always get a smile from people who see them.  &quot;So cute!&quot;  &quot;I love it - what *is* it?&quot;\r\n\r\nI hope you enjoy my creations as much as I do.\r\n\r\nSee my blog for in-depth info on my work, photos, and thoughts:\r\n  http://www.curtinscreations.com\r\n\r\nAnd watch my facebook Page for pictures of Creations in progress, discount codes, to tell your friends, or just to say hi!  (The more the merrier, after all!)\r\n  http://www.facebook.com/CurlyCreatures",
