"policy_payment": "We accept credit card payments via Etsy Checkout.",
"policy_shipping": "We ship worldwide.\r\n\r\nAll US orders are shipped via USPS Priority Mail with delivery confirmation. \r\n\r\nInternational orders under 4 pounds in weight are shipped via USPS First Class Mail without tracking. International orders weighing over 4 pounds are shipped via USPS Priority Mail with tracking. All international orders are fully insured regardless of the shipping method.\r\n\r\nWe gladly offer COMBINED SHIPPING on all items, worldwide.\r\n\r\nWe are also happy to ship via USPS Express Mail if you need an item extra fast. Just send us a message to let us know and we will notify you of the cost for Express Shipping.\r\n\r\nInternational Customers: Please be aware of what your country&#39;s customs rules and fees are. International customers are responsible for paying any and all customs fees and taxes that may be assessed by their country&#39;s customs office upon item delivery. Customs fees are not associated with the seller or the shipping price of the item.",
"policy_refunds": "Our top priority is to provide high quality vintage clothing and wonderful customer service to ensure you are happy with your item. If you have any questions about an item or our policies, or if you would like additional photos of an item, please let us know. We are always happy to help!\r\n\r\nAll vintage items are final sale. Please remember that vintage clothing has been previously loved. Minor normal wear (such as minor fading from age/washing or a couple unnoticeable missing sequins) is often part of a piece&#39;s vintage charm. We have incredibly high standards of quality, and we meticulously inspect every piece stitch by stitch multiple times for flaws. Any flaws beyond minor normal wear are noted in the item&#39;s description. All of our items arrive ready to wear.\r\n\r\nIn the rare event that we have missed a flaw, please notify us immediately if you wish to return the item. In this case, we will only accept a return on an item provided it still has our sales tags attached and is in the same condition in which it was shipped to you. So please inspect your items carefully prior to removing any tags. Returned items must be postmarked within 4 business days.\r\n\r\nReturns due to fit are not accepted. Please refer to the measurements provided in the listing to determine if an item will fit. If you have any questions about whether or not an item will fit, please let us know and we will gladly assist you.",
"policy_additional": "MEASUREMENTS:\r\n-We meticulously measure every item and include all measurements in the description. We also provide an estimated size, but as standardized sizing can vary please keep in mind this is just an estimate. The best way to determine if an item will fit is to refer to the measurements provided. If the fabric has some stretch to it, we will include a range of measurements to represent both the unstretched measurement up to what the fabric will comfortably stretch. (For example, a bust measurement of 32&quot; - 35&quot; indicates the bust measures 32&quot; unstretched and can accommodate up to 35&quot; when stretched). All items are measured laying flat, with the bust, waist and hips measurements doubled. If you have any questions about determining fit, just ask! We are always happy to help!\r\n\r\nPLEASE NOTE:\r\n-Belts and accessories are not included unless otherwise noted in the item description.\r\n\r\n-Some items have been altered for a better fit. All items that are shortened are professionally hemmed.\r\n\r\n-Some items may be pinned in the photos to show proper fit.\r\n\r\n-While we try our hardest to ensure the colors in our photos are as accurate as possible, please note that all monitors display colors differently. Because of this there may be slight color variances between the actual garment and how it appears in the photos.",
